/*Table structure for table `msscheduleteacher` */

DROP TABLE IF EXISTS `msscheduleteacher`;

CREATE TABLE `msscheduleteacher` (
  `ScheduleID` bigint(20) NOT NULL AUTO_INCREMENT,
  `Teacher` varchar(255) NOT NULL,
  `Course` varchar(30) NOT NULL,
  `Kurikulum` varchar(30) NOT NULL,
  `ScheduleDate` date NOT NULL,
  `Session` varchar(30) NOT NULL,
  `PriceBruto` decimal(18,2) DEFAULT NULL,
  `Discount` decimal(18,2) DEFAULT NULL,
  `PriceNetto` decimal(18,2) DEFAULT NULL,
  `Status` varchar(50) NOT NULL,
  `CreatedDate` datetime DEFAULT NULL,
  `Kwalifikasi` varchar(500) DEFAULT NULL,
  `BookedBy` varchar(255) DEFAULT NULL,
  `BookedExpire` datetime DEFAULT NULL,
  `SendToPayment` varchar(1) DEFAULT 'N',
  PRIMARY KEY (`ScheduleID`)
) ENGINE=InnoDB AUTO_INCREMENT=58577 DEFAULT CHARSET=latin1;

