/* Function  structure for function  `get_data_kwalifikasi` */

/*!50003 DROP FUNCTION IF EXISTS `get_data_kwalifikasi` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`DB9758_bimbel`@`%` FUNCTION `get_data_kwalifikasi`(`prmTeacher` VARCHAR(255)) RETURNS varchar(500) CHARSET latin1
BEGIN
	DECLARE xHasil 	VARCHAR(500);
	DECLARE xCourse	VARCHAR(100);
	SET xHasil = '';
	SELECT C.CourseName, CONCAT(C.`CourseName`, ' - ',`Kurikulum`)
	INTO xCourse, xHasil
	FROM `MsKwalifikasi` A INNER JOIN `MsCourse` C ON A.Course = C.CourseID
	WHERE A.`Teacher` = prmTeacher
	ORDER BY A.`Course`, A.`Kurikulum`
	LIMIT 1;
	SELECT C.CourseName, CONCAT(xHasil, CASE WHEN C.`CourseName` = xCourse THEN CONCAT(', ',A.Kurikulum) ELSE CONCAT(CHAR(13),CHAR(10),C.`CourseName`, ' - ',`Kurikulum`) END)
	INTO xCourse, xHasil
	FROM `MsKwalifikasi` A INNER JOIN `MsCourse` C ON A.Course = C.CourseID
	WHERE A.`Teacher` = prmTeacher
	ORDER BY A.`Course`, A.`Kurikulum`
	LIMIT 1,1;
	SELECT C.CourseName, CONCAT(xHasil, CASE WHEN C.`CourseName` = xCourse THEN CONCAT(', ',A.Kurikulum) ELSE CONCAT(CHAR(13),CHAR(10),C.`CourseName`, ' - ',`Kurikulum`) END)
	INTO xCourse, xHasil
	FROM `MsKwalifikasi` A INNER JOIN `MsCourse` C ON A.Course = C.CourseID
	WHERE A.`Teacher` = prmTeacher
	ORDER BY A.`Course`, A.`Kurikulum`
	LIMIT 2,1;
	SELECT C.CourseName, CONCAT(xHasil, CASE WHEN C.`CourseName` = xCourse THEN CONCAT(', ',A.Kurikulum) ELSE CONCAT(CHAR(13),CHAR(10),C.`CourseName`, ' - ',`Kurikulum`) END)
	INTO xCourse, xHasil
	FROM `MsKwalifikasi` A INNER JOIN `MsCourse` C ON A.Course = C.CourseID
	WHERE A.`Teacher` = prmTeacher
	ORDER BY A.`Course`, A.`Kurikulum`
	LIMIT 3,1;
	SELECT C.CourseName, CONCAT(xHasil, CASE WHEN C.`CourseName` = xCourse THEN CONCAT(', ',A.Kurikulum) ELSE CONCAT(CHAR(13),CHAR(10),C.`CourseName`, ' - ',`Kurikulum`) END)
	INTO xCourse, xHasil
	FROM `MsKwalifikasi` A INNER JOIN `MsCourse` C ON A.Course = C.CourseID
	WHERE A.`Teacher` = prmTeacher
	ORDER BY A.`Course`, A.`Kurikulum`
	LIMIT 4,1;
	SELECT C.CourseName, CONCAT(xHasil, CASE WHEN C.`CourseName` = xCourse THEN CONCAT(', ',A.Kurikulum) ELSE CONCAT(CHAR(13),CHAR(10),C.`CourseName`, ' - ',`Kurikulum`) END)
	INTO xCourse, xHasil
	FROM `MsKwalifikasi` A INNER JOIN `MsCourse` C ON A.Course = C.CourseID
	WHERE A.`Teacher` = prmTeacher
	ORDER BY A.`Course`, A.`Kurikulum`
	LIMIT 5,1;
	RETURN xHasil;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_app_student_action_book` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_app_student_action_book` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`DB9758_bimbel`@`%` PROCEDURE `sp_app_student_action_book`(`prmUserLogin` VARCHAR(255), `prmType` VARCHAR(20), `prmID` VARCHAR(50))
BEGIN
	DECLARE xSuccess VARCHAR(1);
	DECLARE xMessage VARCHAR(255);
	DECLARE xTeacher VARCHAR(255);
	DECLARE xScheduleDate DATETIME;
	DECLARE xSession VARCHAR(30);
	
	SET xSuccess= '1';
	SET xMessage = '';
	IF ( prmType = 'Course') THEN
		IF EXISTS ( SELECT 1 FROM `MsScheduleTeacher` WHERE `Status` = 'Book' AND `BookedBy` = prmUserLogin AND `ScheduleID` = prmID) THEN
			SET xSuccess = '0';
			SET xMessage = 'Item sudah ada di keranjang';
		ELSE			
			IF EXISTS ( SELECT 1 FROM `MsScheduleTeacher` WHERE `Status` <> 'Available' AND `ScheduleID` = prmID) THEN
				SET xSuccess = '0';
				SET xMessage = 'Item sudah tidak tersedia';
			ELSE
				SELECT `Teacher`, `ScheduleDate`, `Session`
				INTO xTeacher, xScheduleDate, xSession
				FROM MsScheduleTeacher
				WHERE `ScheduleID` = prmID;
				
				UPDATE `MsScheduleTeacher`
				SET 	`Status` = 'Book',
					`BookedBy` = prmUserLogin,
					`BookedExpire`= DATE_ADD(NOW(), INTERVAL 10 MINUTE)
				WHERE `ScheduleID` = prmID AND `Status` = 'Available';
				
				UPDATE `MsScheduleTeacher`
				SET 	`Status` = 'Not available'
				WHERE `Teacher` = xTeacher AND `ScheduleDate` = xScheduleDate AND `Session` = xSession 
				AND `Status` = 'Available' AND `ScheduleID` <> prmID;
			END IF;
		END IF;
	ELSE
		IF EXISTS ( SELECT 1 FROM `MsOlimpiadeBook` WHERE `OlimpiadeID` = prmID AND `BookedBy` = prmUserLogin AND `Status` IN ('Book', 'Booked')) THEN
			SET xSuccess = '0';
			SET xMessage = 'Olimpiade sudah terpilih';
			
		ELSE
			IF NOT EXISTS ( SELECT 1 FROM `MsOlimpiadeBook` WHERE `OlimpiadeID` = prmID AND `BookedBy` = prmUserLogin) THEN
				INSERT INTO `MsOlimpiadeBook`( `OlimpiadeID`, `BookedBy`, `BookedExpire`, `Status`)
				VALUES ( prmID, prmUserLogin, DATE_ADD(NOW(), INTERVAL 1 DAY), 'Book');
			ELSE
				UPDATE `MsOlimpiadeBook` 
				SET 	`BookedExpire` = DATE_ADD(NOW(), INTERVAL 1 DAY),
					`Status` = 'Book'
				WHERE `OlimpiadeID` = prmID AND `BookedBy` = prmUserLogin AND `Status` IN ('Expired','Cancel');
			END IF;
		END IF;
	END IF;
	SELECT xSuccess AS Success, xMessage AS Message;   
	END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_app_student_action_unbook` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_app_student_action_unbook` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`DB9758_bimbel`@`%` PROCEDURE `sp_app_student_action_unbook`(`prmUserLogin` VARCHAR(255), `prmType` VARCHAR(20), `prmID` BIGINT)
BEGIN
	DECLARE xSuccess VARCHAR(1);
	DECLARE xMessage VARCHAR(255);
	DECLARE xTeacher VARCHAR(255);
	DECLARE xScheduleDate DATETIME;
	DECLARE xSession VARCHAR(30);
	
	SET xSuccess= '1';
	SET xMessage = '';
	IF ( prmType = 'Course') THEN
		SELECT `Teacher`, `ScheduleDate`, `Session`
		INTO xTeacher, xScheduleDate, xSession
		FROM MsScheduleTeacher
		WHERE `ScheduleID` = prmID;
		
		UPDATE `MsScheduleTeacher`
		SET 	`Status` = 'Available',
			`BookedBy` = '',
			`BookedExpire` = NULL
		WHERE `Teacher` = xTeacher AND `ScheduleDate` = xScheduleDate AND `Session` = xSession and ScheduleID = prmID;
		/*				
		UPDATE `MsScheduleTeacher`
		SET 	`Status` = 'Available',
			`BookedBy` = '',
			`BookedExpire`= NULL
		WHERE `ScheduleID` = prmID AND `Status` = 'Book' AND `BookedBy` = prmUserLogin;
		*/
	ELSE
		UPDATE `MsOlimpiadeBook` 
		SET 	`BookedExpire` = null,
			`Status` = 'CANCEL'
		WHERE `BookingID` = prmID AND `Status` IN ('Book','Expired') AND `BookedBy` = prmUserLogin;
	END IF;
	SELECT xSuccess AS Success, xMessage AS Message;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_app_student_cart_list` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_app_student_cart_list` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`DB9758_bimbel`@`%` PROCEDURE `sp_app_student_cart_list`(`prmUserLogin` VARCHAR(255))
BEGIN
	SELECT `SubjectType`, BookingID, `SubjectName`, `SubjectOrganizer`, `SubjectSchedule`, `PriceBruto`, `Discount`, `PriceNetto`, SendToPayment
	FROM `vw_list_cart`
	WHERE `BookedBy` = prmUserLogin;
    END */$$
