/* Procedure structure for procedure `sp_app_student_cart_toggle` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_app_student_cart_toggle` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`DB9758_bimbel`@`%` PROCEDURE `sp_app_student_cart_toggle`(IN `prmUserLogin` VARCHAR(255), IN `prmSubjectType` VARCHAR(30), IN `prmBookingID` VARCHAR(100), IN `prmToggle` VARCHAR(1))
BEGIN
	IF ( prmSubjectType = 'Course') THEN
		UPDATE `MsScheduleTeacher`
		SET `SendToPayment` = prmToggle
		WHERE `BookedBy` = prmUserLogin AND FIND_IN_SET(`ScheduleID`, prmBookingID);
	END IF;
	IF ( prmSubjectType = 'Olimpiade') THEN
		UPDATE `MsOlimpiadeBook`
		SET `SendToPayment` = prmToggle
		WHERE `BookedBy` = prmUserLogin AND FIND_IN_SET(`BookingID`, prmBookingID);
	END IF;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_app_student_course_list` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_app_student_course_list` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`DB9758_bimbel`@`%` PROCEDURE `sp_app_student_course_list`(`prmUserLogin` VARCHAR(255), `prmFilter` VARCHAR(255))
BEGIN
	SELECT A.`ScheduleID`, U.UserName AS `Teacher`, A.`Course`, C.`CourseName`, C.`UrlImage` AS CourseIcon, A.`Kurikulum`,
	A.`ScheduleDate`, A.`Session`, S.SessionName,
	A.`PriceBruto`, A.`Discount`, A.`PriceNetto`,
	A.`Status`, CASE WHEN COALESCE(U.RateCount,0) = 0 THEN 0 ELSE U.RateValue / U.RateCount END Rating
	FROM `MsScheduleTeacher` A INNER JOIN `MsLogin` U ON A.`Teacher` = U.`UserLogin`
	INNER JOIN `MsSession` S ON A.`Session` = S.`SessionID`
	INNER JOIN `MsCourse` C ON A.`Course` = C.`CourseID`
	WHERE (A.`Status` = 'Available' OR (A.`Status` = 'Book' AND A.`BookedBy` = prmUserLogin))
	AND ( C.CourseName LIKE CONCAT('%',prmFilter,'%') OR U.UserName LIKE CONCAT('%',prmFilter,'%')
		OR DATE_FORMAT(A.ScheduleDate, '%d-%b-%Y') LIKE CONCAT('%',prmFilter,'%'))
	AND A.`ScheduleDate` >= DATE(NOW());
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_app_student_course_list_adv_filter` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_app_student_course_list_adv_filter` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`DB9758_bimbel`@`%` PROCEDURE `sp_app_student_course_list_adv_filter`(
	`prmUserLogin` VARCHAR(255), 
	`prmFilter` VARCHAR(255),
	`prmFilterDate` DATE,
	`prmFilterCourse` VARCHAR(255),
	`prmFilterKurikulum` VARCHAR(255),
	`prmFilterPriceMin` VARCHAR(255),
	`prmFilterPriceMax` VARCHAR(255),
	`prmFilterRating` NUMERIC(5)
)
BEGIN
	SELECT A.`ScheduleID`, U.UserName AS `Teacher`, A.`Course`, C.`CourseName`, C.`UrlImage` AS CourseIcon, A.`Kurikulum`,
	A.`ScheduleDate`, A.`Session`, S.SessionName,
	A.`PriceBruto`, A.`Discount`, A.`PriceNetto`,
	A.`Status`, CASE WHEN COALESCE(U.RateCount,0) = 0 THEN 0 ELSE U.RateValue / U.RateCount END Rating
	FROM `MsScheduleTeacher` A INNER JOIN `MsLogin` U ON A.`Teacher` = U.`UserLogin`
	INNER JOIN `MsSession` S ON A.`Session` = S.`SessionID`
	INNER JOIN `MsCourse` C ON A.`Course` = C.`CourseID`
	WHERE (A.`Status` = 'Available' OR (A.`Status` = 'Book' AND A.`BookedBy` = prmUserLogin))
	AND ( C.CourseName LIKE CONCAT('%',prmFilter,'%') OR U.UserName LIKE CONCAT('%',prmFilter,'%')
		OR DATE_FORMAT(A.ScheduleDate, '%d-%b-%Y') LIKE CONCAT('%',prmFilter,'%'))
	AND A.`ScheduleDate` >= DATE(NOW());
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_app_student_create_order` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_app_student_create_order` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`DB9758_bimbel`@`%` PROCEDURE `sp_app_student_create_order`(`prmPaymentType` VARCHAR(30), `prmAdmin` NUMERIC(18,2), `prmUserLogin` VARCHAR(255))
BEGIN
	DECLARE xTotal  NUmeric(18,2);
	DECLARE prmNmbr VarChar(150);
	SET prmNmbr = UUID();
	SET xTotal = (SELECT SUM(PriceNetto) FROM `vw_list_cart` WHERE SendToPayment = 'Y' AND `BookedBy` = prmUserLogin);
	INSERT INTO `TrOrderHd`(TransNmbr, `Status`, `TransDate`, `PaymentType`, `Bruto`, `Tax`, `Admin`, `Total`, `ExpireDate`, `UserLogin`)
	VALUES ( prmNmbr, 'Booked', NOW(), prmPaymentType, xTotal, 0, prmAdmin, xTotal + prmAdmin, DATE_ADD(NOW(), INTERVAL 6 HOUR), prmUserLogin);
	INSERT INTO `TrOrderDt`(TransNmbr, `ItemNo`, `SubjectType`, `BookingId`, `SubjectName`, `SubjectOrganizer`,
		`SubjectSchedule`, `CourseID`, `Kurikulum`, `TeacherID`, `OlimpiadeID`, `ScheduleDate`, `SessionID`,
		Qty, `Price`, `Amount`, `Discount`, `Netto`, `StatusProcess`, `Rating`)
	SELECT prmNmbr, 0, `SubjectType`, `BookingId`, `SubjectName`, `SubjectOrganizer`,
		`SubjectSchedule`, `CourseID`, `Kurikulum`, `Teacher`, `OlimpiadeID`, `ScheduleDate`, `SessionID`,
		1, `PriceBruto`, `PriceBruto`, `Discount`, `PriceNetto`, '', 0
	FROM `vw_list_cart`
	WHERE SendToPayment = 'Y' AND `BookedBy` = prmUserLogin;
	UPDATE `MsScheduleTeacher` INNER JOIN TrOrderDt ON TrOrderDt.`SubjectType` = 'Course'
	SET 	MsScheduleTeacher.`Status` = 'Booked'
	WHERE TrOrderDt.`TransNmbr` = prmNmbr  AND MsScheduleTeacher.`ScheduleID` = TrOrderDt.BookingID; 	
	
	UPDATE `MsOlimpiadeBook` INNER JOIN TrOrderDt ON TrOrderDt.`SubjectType` = 'Olimpiade'
	SET 	MsOlimpiadeBook.`Status` = 'Booked'
	WHERE TrOrderDt.`TransNmbr` = prmNmbr  AND MsOlimpiadeBook.`BookingID` = TrOrderDt.BookingID; 	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_app_student_getpaymenttype` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_app_student_getpaymenttype` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`DB9758_bimbel`@`%` PROCEDURE `sp_app_student_getpaymenttype`()
BEGIN
	SELECT `PaymentID`, `AccountNo`, `AccountName`, `AdminFee`, `PaymentIcon` FROM `MsPayment`
