/* Procedure structure for procedure `sp_app_student_olimpiade_list` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_app_student_olimpiade_list` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`DB9758_bimbel`@`%` PROCEDURE `sp_app_student_olimpiade_list`(`prmUserLogin` VARCHAR(255), `prmFilter` VARCHAR(255))
BEGIN
	SELECT A.`OlimpiadeID`, A.`OlimpiadeName`, A.`ExamDateStart`, A.`ExamDateEnd`, A.`RegistrationDate`, A.`UrlImage`, A.`UrlImage2`, A.Price, 
	V.`VenueName` AS `Venue`, O.`OrganizerName` AS `Organizer` 
	FROM `MsOlimpiade` A INNER JOIN `MsOrganizer` O ON A.`Organizer` = O.`OrganizerID`
	INNER JOIN `MsVenue` V ON A.`Venue` = V.`VenueID`
	WHERE A.`RegistrationDate` >= DATE(NOW()) AND A.`FgActive` = 'Y';
	-- AND NOT EXISTS ( SELECT 1 FROM `MsOlimpiadeBook` B WHERE B.BookedBy = prmUserLogin AND B.OlimpiadeID = A.OlimpiadeID AND B.Status in ('Book', 'Booked') );
    END */$$
