/* Procedure structure for procedure `sp_app_student_view_order_dt` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_app_student_view_order_dt` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`DB9758_bimbel`@`%` PROCEDURE `sp_app_student_view_order_dt`(`prmNmbr` VARCHAR(100), `prmUserLogin` VARCHAR(255))
BEGIN
	SELECT ItemNo, `SubjectType`, `SubjectName`, `SubjectSchedule`, `SubjectOrganizer`, Netto, `StatusProcess`, Rating, `TeacherID` 
	FROM `TrOrderDt` 
	WHERE `TransNmbr` = prmNmbr
	ORDER BY `ItemNo`;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_app_student_view_order_hd` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_app_student_view_order_hd` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`DB9758_bimbel`@`%` PROCEDURE `sp_app_student_view_order_hd`(IN `prmUserLogin` VARCHAR(255), IN `prmIndex` BIGINT)
BEGIN
	DECLARE xFirstIndex	BIGINT;
	
	SET xFirstIndex = ( SELECT `OrderID` FROM `TrOrderHd` WHERE UserLogin = prmUserLogin ORDER BY `OrderID` LIMIT 1);
	SET xFirstIndex = COALESCE(xFirstIndex,-1);
	
	SELECT TrOrderHd.`OrderID`, TrOrderHd.`TransNmbr`, TrOrderHd.`Status`, TrOrderHd.`TransDate`, 
		TrOrderHd.`PaymentType`, `MsPayment`.`PaymentIcon`, `MsPayment`.`AccountNo`, `MsPayment`.`AccountName`, 
		TrOrderHd.Total, TrOrderHd.`ExpireDate`, TrOrderHd.`UploadDate`, TrOrderHd.`UploadFile`,
		CASE WHEN `TrOrderHd`.`OrderID` =  xFirstIndex THEN 'N' ELSE 'Y' END FgLoadMore
	FROM `TrOrderHd` INNER JOIN `MsPayment` ON `TrOrderHd`.`PaymentType` = `MsPayment`.`PaymentID`
	WHERE `TrOrderHd`.`UserLogin` = prmUserLogin AND `TrOrderHd`.`OrderID` < prmIndex
	ORDER BY `TrOrderHd`.`OrderID` DESC
	LIMIT 0,10;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_app_student_view_order_rating` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_app_student_view_order_rating` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`DB9758_bimbel`@`%` PROCEDURE `sp_app_student_view_order_rating`(`prmNmbr` VARCHAR(50), `prmItemNo` INT, `prmRate` INT, `prmUserLogin` VARCHAR(255))
BEGIN
	DECLARE xSuccess 	VarChar(1);
	DECLARE xMsg 		VARCHAR(255);
	
	SET xSuccess = '1';
	SET xMsg = '';
	
	UPDATE `TrOrderDt`
	SET 	`StatusProcess` = 'Complete',
		`Rating` = prmRate
	WHERE `TransNmbr` = prmNmbr AND `ItemNo` = prmItemNo AND COALESCE(`StatusProcess`,'') <> 'Complete';
	
	SELECT xSuccess As Success, xMsg As Message;
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_app_student_view_order_uploadtransfer` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_app_student_view_order_uploadtransfer` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`DB9758_bimbel`@`%` PROCEDURE `sp_app_student_view_order_uploadtransfer`(`prmOrderID` BIGINT, `prmUrlFile` VARCHAR(255), `prmUserLogin` VARCHAR(255))
BEGIN
	DECLARE xSuccess 	VarChar(1);
	DECLARE xMsg 		VARCHAR(255);
	
	SET xSuccess = '1';
	SET xMsg = '';
	
	IF EXISTS ( SELECT `Status` FROM `TrOrderHd` WHERE `OrderID` = prmOrderID AND `Status` = 'Booked') THEN
		UPDATE `TrOrderHd`
		SET 	`Status` = 'Bukti Bayar',
			`UploadDate` = NOW(),
			`UploadFile` = prmUrlFile
		WHERE `OrderID` = prmOrderID AND `Status` ='Booked';
	ELSE 
		SET xSuccess = '0';
		SET xMsg = 'Failed upload, status order harus Booked';
	END IF;
	SELECT xSuccess As Success, xMsg As Message;
	
    END */$$
DELIMITER ;

