/* Procedure structure for procedure `sp_app_teacher_price_list` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_app_teacher_price_list` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`DB9758_bimbel`@`%` PROCEDURE `sp_app_teacher_price_list`(`prmUserLogin` VARCHAR(255))
BEGIN
	DECLARE xDate	Date;
	SET xDate = DATE(NOW());
	SELECT A.`Course`, C.`CourseName`, C.`UrlImage` AS CourseIcon, A.`StartEffective`, A.`PriceBruto`, A.`Discount`, A.`PriceNetto`, A.`Kurikulum`
	FROM vw_mspricelist A INNER JOIN `MsCourse` C ON A.`Course` = C.`CourseID`
	WHERE A.`Teacher` = prmUserLogin AND xDate BETWEEN A.`StartEffective` AND A.`EndEffective`;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_app_teacher_price_submit` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_app_teacher_price_submit` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`DB9758_bimbel`@`%` PROCEDURE `sp_app_teacher_price_submit`(IN `prmUserLogin` VARCHAR(255), IN `prmCourse` VARCHAR(100), IN `prmKurikulum` VARCHAR(50), IN `prmEffectiveDate` DATE, IN `prmBruto` FLOAT, IN `prmDiscount` FLOAT)
BEGIN
	DECLARE xSuccess VARCHAR(1);
	DECLARE xMessage VARCHAR(255);
	DECLARE xDate	Date;
	SET xSuccess = '1';
	SET xMessage = '';
	IF ( prmDiscount > prmBruto) THEN
		SET xSuccess = '0';
		SET xMessage = 'Discount cannot greater than Bruto';
	END IF;
	SET xDate = DATE(NOW());
	IF ( prmEffectiveDate < xDate) THEN
		SET xSuccess = '0';
		SET xMessage = CONCAT('Effective Date must greater than ', DATE_FORMAT(xDate, '%d-%b-%y'));
	END IF;
	IF EXISTS ( SELECT 1 FROM `MsPrice` WHERE Course = prmCourse AND `Kurikulum` = prmKurikulum AND Teacher = prmUserLogin AND `StartEffective` >= prmEffectiveDate) THEN
		SET xDate = ( SELECT `StartEffective` FROM `MsPrice` WHERE Course = prmCourse AND `Kurikulum` = prmKurikulum AND Teacher = prmUserLogin AND `StartEffective` >= prmEffectiveDate ORDER BY `StartEffective` DESC LIMIT 1);
		SET xSuccess = '0';
		SET xMessage = CONCAT('Effective Date must greater than ', DATE_FORMAT(xDate, '%d-%b-%y'));
	END IF;
	IF ( xSuccess = '1') THEN
		INSERT INTO `MsPrice` ( `Course`, `Kurikulum`, `Teacher`, `StartEffective`, `PriceBruto`, `Discount`, `PriceNetto`, `CreatedBy`, `CreatedDate`)
		VALUES ( prmCourse, prmKurikulum, prmUserLogin, prmEffectiveDate, prmBruto, prmDiscount, prmBruto - prmDiscount, prmUserLogin, now() );
	END IF;
	SELECT 	xSuccess AS Success, xMessage AS Message;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_app_teacher_schedule_add_list` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_app_teacher_schedule_add_list` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`DB9758_bimbel`@`%` PROCEDURE `sp_app_teacher_schedule_add_list`(IN `prmUserLogin` VARCHAR(255) CHARSET utf8mb4, IN `prmScheduleDate` DATETIME, IN `prmSessionGroup` VARCHAR(30) CHARSET utf8mb4)
BEGIN
	DECLARE xSuccess VarChar(1);
		DECLARE xMessage VARCHAR(255);
		DROP TEMPORARY TABLE IF EXISTS listsession;
		create temporary table if not exists listsession (
			`SessionID` VARCHAR(30) null,
			SessionName VARCHAR(50) null,
			FgCanToggle VarChar(01) default 'Y',
			`Status` VARCHAR(20) null default 'Available',
			FgCheck VarChar(1) default 'Y'
		);
		SET xSuccess = '1';
		SET xMessage = '';
		IF NOT EXISTS (
			SELECT 1
			FROM MsKwalifikasi
			WHERE `Teacher` = prmUserLogin
		) THEN
		Set xSuccess = '0';
		SET xMessage = 'Kwalifikasi Teacher is empty';
		END IF;
		IF NOT EXISTS (
			SELECT 1
			FROM MsKwalifikasi A
				INNER JOIN `MsPrice` P ON A.Course = P.Course
				AND A.Kurikulum = P.Kurikulum
			WHERE A.`Teacher` = prmUserLogin
		) THEN
		SET xSuccess = '0';
		SET xMessage = 'Price Kwalifikasi is empty';
		END IF;
		IF (xSuccess = '1') THEN
		INSERT INTO listsession (SessionID, `SessionName`)
		SELECT `SessionID`,
			`SessionName`
		FROM `MsSession`
		WHERE `SessionGroup` = prmSessionGroup
			AND `FgActive` = 'Y';
		UPDATE listsession
			INNER JOIN `vw_msschedulelist` ON listsession.SessionID = vw_msschedulelist.`Session`
		SET listsession.Status = vw_msschedulelist.`Status`,
			listsession.FgCanToggle = CASE
				WHEN vw_msschedulelist.`Status` = 'Available' THEN 'Y'
				ELSE 'N'
			END,
			listsession.FgCheck = CASE
				WHEN vw_msschedulelist.`Status` = 'Available' THEN 'Y'
				ELSE 'N'
			END
		WHERE vw_msschedulelist.Teacher = prmUserLogin
			AND vw_msschedulelist.`ScheduleDate` = prmScheduleDate;
		UPDATE listsession
		SET FgCheck = 'X'
		WHERE FgCanToggle = 'N';
		END IF;
		SELECT xSuccess AS Success,
			xMessage AS Message,
			SessionID,
			`SessionName`,
			`Status`,
			FgCheck
		FROM listsession;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_app_teacher_schedule_add_submit` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_app_teacher_schedule_add_submit` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`DB9758_bimbel`@`%` PROCEDURE `sp_app_teacher_schedule_add_submit`(IN `prmUserLogin` VARCHAR(255), IN `prmScheduleDate` DATE, IN `prmSession` VARCHAR(30), IN `prmCheck` VARCHAR(1))
BEGIN
	DECLARE xKwalifikasi VarChar(500);
	
	IF (prmCheck = 'N') THEN
		DELETE from `MsScheduleTeacher` WHERE `Teacher` = prmUserLogin AND `ScheduleDate` = prmScheduleDate AND `Session` = prmSession AND `Status` = 'Available';
	ELSE
		SEt xKwalifikasi = get_data_kwalifikasi(prmUserLogin);
		INSERT INTO `MsScheduleTeacher`( `Teacher`, `Course`, `Kurikulum`, `ScheduleDate`, `Session`, `PriceBruto`, `Discount`, `PriceNetto`, `Status`, `CreatedDate`, `Kwalifikasi`)
		SELECT `Teacher`, `Course`, `Kurikulum`, prmScheduleDate, prmSession, `PriceBruto`, `Discount`, `PriceNetto` , "Available" AS Status, NOW(), xKwalifikasi
		FROM `vw_mspricelist`
		WHERE `Teacher` = prmUserLogin AND prmScheduleDate BETWEEN `StartEffective` AND `EndEffective`;
	END IF;
	
	SELECT '1' AS Success, '' AS Message;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_app_teacher_schedule_getsessiongroup` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_app_teacher_schedule_getsessiongroup` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`DB9758_bimbel`@`%` PROCEDURE `sp_app_teacher_schedule_getsessiongroup`()
BEGIN
	SELECT distinct `SessionGroup`
	FROM `MsSession`
	WHERE `FgActive` = 'Y';
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_app_teacher_schedule_list` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_app_teacher_schedule_list` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`DB9758_bimbel`@`%` PROCEDURE `sp_app_teacher_schedule_list`(`prmUserLogin` VARCHAR(255))
BEGIN
	DECLARE xDate	DATE;
	SET xDate = DATE(NOW());

	DROP TEMPORARY TABLE IF EXISTS jadwal;
	CREATE TEMPORARY TABLE IF NOT EXISTS jadwal
	(	
		ScheduleId	BIGINT NULL,
		ScheduleDate	DateTime NULL,
		`Session`	VARCHAR(30) NULL,
		SessionName	VarChar(50) NULL,
		`Course` 	VARCHAR(500) NULL,
		`Status` 	VARCHAR(20) NULL,
		FgCanDelete	VarChar(1) DEFAULT 'Y'
	);

	INSERT INTO jadwal ( ScheduleId, ScheduleDate, `Session`, SessionName, `Course`, `Status`)
	SELECT A.`ScheduleId`, A.`ScheduleDate`, A.`Session`, S.`SessionName`, A.Kwalifikasi, A.Status
	FROM vw_msschedulelist A INNER JOIN `MsSession` S ON A.Session = S.SessionID
	WHERE A.`Teacher` = prmUserLogin AND A.`ScheduleDate` >= xDate;

	UPDATE jadwal
	SET	FgCanDelete = 'N'
	WHERE `Status` = 'Booked';

	SELECT * FROM jadwal
	ORDER BY `ScheduleDate`, `Session`;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_app_teacher_view_order` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_app_teacher_view_order` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`DB9758_bimbel`@`%` PROCEDURE `sp_app_teacher_view_order`(IN `prmUserLogin` VARCHAR(255), IN `prmIndex` BIGINT)
BEGIN
	DECLARE xFirst BIGINT;
	
	SET xFirst = (SELECT `TrOrderHd`.`OrderID` FROM `TrOrderHd` INNER JOIN `TrOrderDt` ON `TrOrderHd`.`TransNmbr` = `TrOrderDt`.`TransNmbr`
		WHERE `TrOrderHd`.`Status` <> 'Bayar' AND TrOrderDt.TeacherID = prmUserLogin
		AND `TrOrderHd`.`OrderID` < prmIndex
		ORDER BY `TrOrderHd`.`OrderID`
		LIMIT 1);
	SET xFirst = COALESCE(xFirst,-1);
	
	SELECT `TrOrderHd`.`OrderID`, `TrOrderHd`.`TransNmbr`, `TrOrderDt`.`ItemNo`, `TrOrderDt`.`SubjectType`, `TrOrderDt`.`SubjectName`, `TrOrderDt`.`SubjectSchedule`, `TrOrderDt`.`Netto`, 
		`TrOrderDt`.`StatusProcess`, `TrOrderDt`.`Rating`,
		CASE WHEN `TrOrderHd`.`OrderID` = xFirst THEN 'N' ELSE 'Y' END FgLoadMore
	FROM `TrOrderHd` INNER JOIN `TrOrderDt` ON `TrOrderHd`.`TransNmbr` = `TrOrderDt`.`TransNmbr`
	WHERE `TrOrderHd`.`Status` <> 'Bayar' AND TrOrderDt.TeacherID = prmUserLogin AND `TrOrderHd`.`OrderID` < prmIndex
	ORDER BY OrderID DESC LIMIT 10;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_app_teacher_view_order_done` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_app_teacher_view_order_done` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`DB9758_bimbel`@`%` PROCEDURE `sp_app_teacher_view_order_done`(`prmNmbr` VARCHAR(50), `prmItemNo` INT, `prmUserLogin` VARCHAR(255))
BEGIN
	DECLARE xSuccess 	VarChar(1);
	DECLARE xMsg 		VARCHAR(255);
	
	SET xSuccess = '1';
	SET xMsg = '';
	
	UPDATE `TrOrderDt`
	SET 	`StatusProcess` = 'Done',
		`ExpireProcess` = DATE_ADD(NOW(), INTERVAL 1 DAY),
		`Rating` = 0
	WHERE `TransNmbr` = prmNmbr AND `ItemNo` = prmItemNo AND COALESCE(`StatusProcess`,'') = '';
	
	SELECT xSuccess As Success, xMsg As Message;
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_app_user_generate_token` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_app_user_generate_token` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`DB9758_bimbel`@`%` PROCEDURE `sp_app_user_generate_token`(`prmUserLogin` VARCHAR(100))
BEGIN
	DECLARE xToken VarChar(4);
	SET xToken = RIGHT(RAND(),4);
	UPDATE `MsLogin`
	SET 	`Token` = xToken
	WHERE `UserLogin` = prmUserLogin;
	SELECT '1' As Success, CONCAT('Catalist-Bimbel',Char(10),Char(13),'Your token number : ',xToken) AS Message, prmUserLogin AS WhatAppsNo;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_app_user_isnew` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_app_user_isnew` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`DB9758_bimbel`@`%` PROCEDURE `sp_app_user_isnew`(`prmUserLogin` VARCHAR(100))
BEGIN
	DECLARE xNewUser VarChar(1);
	IF EXISTS ( SELECT 1 FROM `MsLogin` WHERE UserLogin = prmUserLogin) THEN
		SET xNewUser = 'N';
	ELSE
		SET xNewUser = 'Y';
	END IF;
	SELECT '1' As Success, '' AS Message, xNewUser AS NewUser;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_app_user_login` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_app_user_login` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`DB9758_bimbel`@`%` PROCEDURE `sp_app_user_login`(`prmUserLgin` VARCHAR(255), `prmLoginType` VARCHAR(20), `prmToken` VARCHAR(10))
BEGIN
	DECLARE xSuccess VARCHAR(1);
	DECLARE xMessage VARCHAR(255);
	SET xSuccess = '1';
	SET xMessage = '';
	IF ( prmLoginType = 'Whatapps') THEN
	    IF NOT EXISTS ( SELECT 1 FROM MsLogin WHERE `UserLogin` = prmUserLogin AND `Token` = prmToken) THEN
		SET xMessage = 'Invalid token';
		SET xSuccess = '0';
	    END IF;
	END IF;
	IF ( xSuccess = '0') THEN
		SELECT xSuccess AS Success, xMessage AS Message;
	ELSE
		SELECT xSuccess AS Success, xMessage AS Message,
		UserLogin, UserType, `LoginType`, UserName, Gender, `BirthDate`, `Email`, `Handphone`, `AddressHome`,
		`ClassNo`, `SchoolName`, `ClassTeacher`, `UrlPhoto`
		FROM `MsLogin`
		WHERE UserLogin = prmUserLogin;
	END IF;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_app_user_register` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_app_user_register` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`DB9758_bimbel`@`%` PROCEDURE `sp_app_user_register`(`prmUserLogin` VARCHAR(255), `prmLoginType` VARCHAR(20), `prmUserName` VARCHAR(100), `prmGender` VARCHAR(10), `prmBirthDate` DATE, `prmEmail` VARCHAR(100), `prmHandphone` VARCHAR(30), `prmAddress` VARCHAR(255), `prmClass` INT, `prmSchoolName` VARCHAR(100), `prmClassTeacher` VARCHAR(100))
BEGIN
	IF NOT EXISTS ( SELECT 1 from MsLogin WHERE UserLogin = prmUserLogin) THEN
		INSERT INTO `MsLogin` ( `UserLogin`, `UserType`, `LoginType`, `UserName`, `Gender`, `BirthDate`, `Email`, `Handphone`, `AddressHome`,
			`ClassNo`, `SchoolName`, `ClassTeacher`, `UrlPhoto`, `Token`, `FgActive`, `CreatedBy`, `CreatedDate`)
		Values ( prmUserLogin, 'Student', prmLoginType, prmUserName,  prmGender, prmBirthDate,
			CASE WHEN prmLoginType = 'Mail' THEN prmUserLogin ELSE prmEmail END,
			CASE WHEN prmLoginType = 'Whatapps' THEN prmUserLogin ELSE prmHandphone END,
			prmAddress, prmClass, prmSchoolName, prmClassTeacher, '', '', 'Y', 'Admin', NOW());
	END IF;
	SELECT '1' AS Success, '' AS Message;
    END */$$
DELIMITER ;

/*Table structure for table `vw_list_cart` */

DROP TABLE IF EXISTS `vw_list_cart`;

/*!50001 DROP VIEW IF EXISTS `vw_list_cart` */;
/*!50001 DROP TABLE IF EXISTS `vw_list_cart` */;

/*!50001 CREATE TABLE  `vw_list_cart`(
 `SubjectType` varchar(9) ,
 `BookingID` bigint(20) ,
 `SubjectOrganizer` varchar(100) ,
 `SubjectName` varchar(255) ,
 `CourseID` varchar(30) ,
 `Kurikulum` varchar(30) ,
